import React from 'react';

// import "./pool2.css";

import { Button, Row } from "react-bootstrap";

function ldrDai() {
    return (
      <div className="cd_main">
        <div className="cd_wrapper">
          <div className="cd">
            <Row className="row_css">
              <p className="count_p">Next Epoch</p>
            </Row>
            <Row className="row_css">
              <h2 className="count_h2"></h2>
            </Row>
          </div>
        </div>
      </div>
    );
}
export default ldrDai
